import React from 'react';
import { Box, Button, Text, Grommet, Main, Heading } from 'grommet';
import { useHistory } from "react-router-dom";
import Foooter from './component/Foooter';
import Headerr from './component/Headerr';
import CardsForm from './component/CardsForm';



function App() {

  const theme = {
    global: {
      colors: {
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };


  return (
    <Grommet theme={theme}>
      <Headerr />

      <Main pad="small" margin={{ left: 'large', right: 'large'}} >
        <Box>
          <Heading margin={{ left: "small",top: "small", bottom: "none"}}>Hello, Jane!</Heading>
          <Text margin="small">Welcome to the HPE Common Cloud Console.</Text>
        </Box>

        <CardsForm />

      </Main>

      <Foooter />
    </Grommet>
  );
}

export default App;
